import React, { useEffect } from 'react';
import '../styles/components.css';

const Resume = () => {

  useEffect(() => {
    // Function to handle legend item and chart segment hover interactions
    const setupChartInteractions = () => {
      const legendItems = document.querySelectorAll('.legend-item');
      const chartSegments = document.querySelectorAll('.chart-segment');

      // Function to highlight a segment and its legend item
      const highlightSegment = (segmentClass) => {
        // Find the corresponding chart segment and legend item
        const segment = document.querySelector(`.chart-segment.segment-${segmentClass}`);
        const legendItem = document.querySelector(`.legend-item .legend-color.${segmentClass}`).parentNode;

        if (segment && legendItem) {
          // Highlight the segment and legend item
          segment.classList.add('segment-highlighted');
          legendItem.classList.add('active');

          // Show percentage for the highlighted segment
          const percentage = segment.getAttribute('data-percentage');
          if (percentage) {
            // Create or update percentage display
            let percentageDisplay = document.querySelector('.percentage-display');
            if (!percentageDisplay) {
              percentageDisplay = document.createElement('div');
              percentageDisplay.className = 'percentage-display';
              segment.parentNode.appendChild(percentageDisplay);
            }

            // Get the segment color for the indicator
            const segmentFill = window.getComputedStyle(segment).fill || 
                             window.getComputedStyle(segment).backgroundColor;

            // Format the segment class name for display (capitalize first letter, add spaces)
            const formattedLabel = segmentClass
              .replace(/([A-Z])/g, ' $1')
              .replace(/^./, str => str.toUpperCase())
              .trim();

            // Update tooltip content with percentage on top and label below
            percentageDisplay.innerHTML = `
              <div class="percentage-value">${percentage}%</div>
              <div class="percentage-label">${formattedLabel}</div>
            `;
            percentageDisplay.style.display = 'block';

            // Position the tooltip above the segment
            const rect = segment.getBoundingClientRect();
            const tooltipHeight = percentageDisplay.offsetHeight;
            percentageDisplay.style.top = `${rect.top - tooltipHeight - 10}px`;
            percentageDisplay.style.left = `${rect.left + (rect.width / 2)}px`;
            percentageDisplay.style.transform = 'translateX(-50%)';
          }

          // Hide all other segments and legend items
          document.querySelectorAll(`.chart-segment:not(.segment-${segmentClass})`).forEach(otherSegment => {
            otherSegment.style.opacity = '0.2';
          });

          document.querySelectorAll(`.legend-item:not(:has(.legend-color.${segmentClass}))`).forEach(otherLegend => {
            otherLegend.style.opacity = '0.3';
          });
        }
      };

      // Function to reset all highlights
      const resetHighlights = () => {
        // Remove all highlights
        document.querySelectorAll('.chart-segment').forEach(segment => {
          segment.classList.remove('segment-highlighted');
          segment.style.opacity = '';
        });

        document.querySelectorAll('.legend-item').forEach(item => {
          item.classList.remove('active');
          item.style.opacity = '';
        });

        // Hide percentage display
        const percentageDisplay = document.querySelector('.percentage-display');
        if (percentageDisplay) {
          percentageDisplay.style.display = 'none';
        }
      };

      // Set up legend item hover events
      legendItems.forEach(item => {
        // Get the class name of the color span to identify which segment to highlight
        const colorSpan = item.querySelector('.legend-color');
        if (!colorSpan) return;

        // Extract the class that identifies the segment (e.g., 'python', 'aws', etc.)
        const segmentClass = Array.from(colorSpan.classList)
          .find(cls => cls !== 'legend-color');

        if (!segmentClass) return;

        // Add mouse enter event listener to legend item
        item.addEventListener('mouseenter', () => {
          resetHighlights();
          highlightSegment(segmentClass);
        });

        // Add mouse leave event listener to legend item
        item.addEventListener('mouseleave', resetHighlights);
      });

      // Set up chart segment hover events
      chartSegments.forEach(segment => {
        // Extract the class that identifies the segment
        const segmentClass = Array.from(segment.classList)
          .find(cls => cls.startsWith('segment-') && cls !== 'chart-segment')
          ?.replace('segment-', '');

        if (!segmentClass) return;

        // Add mouse enter event listener to chart segment
        segment.addEventListener('mouseenter', () => {
          resetHighlights();
          highlightSegment(segmentClass);
        });

        // Add mouse leave event listener to chart segment
        segment.addEventListener('mouseleave', resetHighlights);
      });
    };

    // Call the setup function after a short delay to ensure DOM is fully loaded
    const timer = setTimeout(() => {
      setupChartInteractions();
    }, 500);

    // Cleanup function
